import React from "react";
import { Switch, Route } from "react-router-dom";
import Cadastrar from "./Cadastrar"

export default () => {
    return(
        <Switch>
            <Route exec path="/">

            </Route>

            <Route exec path="/cadastrar">
                <Cadastrar></Cadastrar>
            </Route>
        </Switch>
    )
}
